import React, { useEffect } from 'react'
import { ImagePath } from '../../Axios'
import './Order.css'
import NavBar from '../../Components/Navbar/NavBar'

import { useSelector, useDispatch } from 'react-redux'
import { fetchOrder } from '../../Features/Order'

function Order() {
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(fetchOrder())
    }, [dispatch])
    const { OrderInfo} = useSelector(state => state.order)
    return (
        <div className='order-container'>
            <NavBar />
            <div className='order-body'>
                <div className='order-body-header'>
                    <div className='order-body-header-left'>
                        <h1 className='order-h1-myorder'>My Order</h1>
                    </div>
                    <div className='order-body-header-right'>
                    </div>
                </div>
                <div className='order-body-products'>
                    {
                        OrderInfo.map((item, index) => {
                            return (
                                <div className='order-body-prdouct'>
                                    <div className='order-body-product-details'>
                                        <div className='order-body-product-details-image'>
                                            {
                                                item.products.map((product, index) => {
                                                    return (
                                                        <img/ >
                                                    )
                                                })
                                            }
                                        </div>
                                    </div>
                                </div>
                            )
                        })
                    }

                </div>
            </div>
        </div>
    )

}

export default Order
